INSERT INTO `client_event_comments` VALUES (9,48,'Поставить задачу для начала работы в CRM',3,5,'2023-05-12 18:06:08','2023-05-12 18:06:08'),(10,47,'Событие завершено',3,5,'2023-05-15 08:26:11','2023-05-15 08:26:11'),(11,49,'16.02.2023> нет обратной связи\n06.02.2023> запрос КП на две Шнивы комфорт\n24.01.2023> закупают через сыктывкарский филиал газораспределения\n12.04.2022> предложил авто со склада\n24.08.2021> направил запрос по планам\n22.12.2020> направил запрос на 2021 год\n21.05.2020> направил запрос по планам на Рено и Ладу\n23.01.2020> цена вопроса в плане 2700000 за 1 штуку, это точно не Рено, но в любом случае держу связь с клиентом\n23.01.2020> увидел в СБИС план на покупку машин апрель-май, позвонил Максиму, он что-то не в курсе, обещал разузнать и дать обратную связь\n19.12.2019> планов на покупку легковых а/м пока нет\n19.12.2019> отправил запрос по планам на год, позвонить\n26.04.2019> Познакомился, провел переговоры. На этот год покупки не планируют, связь в конце года. Принимает решение Игорь sas@mrg011.ru\n25.04.2019> Контрольный звонок',4,6,'2023-05-15 15:42:56','2023-05-15 15:42:56'),(12,49,'Уточнить план закупки АМ',4,6,'2023-05-15 15:46:46','2023-05-15 15:46:46'),(13,48,'Обучение для сотрудников КСО (ЮГОР, 10:00)',5,7,'2023-05-15 16:15:39','2023-05-15 16:15:39'),(14,48,'Проверка базы проданных автомобилей на перепродажу',6,8,'2023-05-15 17:35:34','2023-05-15 17:35:34'),(15,49,'Купил в др.месте\n13.03.2023> закупили у других\n06.03.2023> Выбирают поставщика, возможен самовывоз от нас. На рассмотрении\nOk.Другая причина\n27.02.2023> Киров, запрос КП на гранту седан, направляю',7,9,'2023-05-16 09:02:51','2023-05-16 09:02:51'),(16,49,'контрольный звонок (Юлия)',7,9,'2023-05-16 09:04:02','2023-05-16 09:04:02'),(17,49,'контрольный звонок(Юлия)',7,9,'2023-05-16 09:05:08','2023-05-16 09:05:08'),(18,49,'Запрос на закупку УАЗ фермер, направил КП на ВИС Ниву бортовую',8,10,'2023-05-16 09:11:28','2023-05-16 09:11:28'),(19,49,'Обновить КП на Ниву борт',8,10,'2023-05-16 09:12:03','2023-05-16 09:12:03'),(20,49,'Связаться когда появятся выписки Минпромторга\nЗапрашивали КП для закупки Трэвел по 44ФЗ, поставка Котлас.\nНа момент направления КП и сейчас нет выписки Минпромторга, закупка невозможна.',9,11,'2023-05-16 09:16:16','2023-05-16 09:16:16'),(21,49,'Связаться когда появятся выписка Минпромторга\nЗапрашивали КП на Трэвел по 44ФЗ. На момент сбора КП не было выписок Минпромторга.',10,12,'2023-05-16 09:19:05','2023-05-16 09:19:05'),(22,49,'Связаться, когда появятся выписки Минпромторга\nЗапрос КП для закупки Трэвел',11,13,'2023-05-16 09:23:29','2023-05-16 09:23:29'),(23,49,'Связь по появлению выписок',10,12,'2023-05-16 09:24:10','2023-05-16 09:24:10'),(24,49,'Позвать на ТО - 0\nЗакупка состоялась, выдача 17.05.23',12,14,'2023-05-16 09:25:44','2023-05-16 09:25:44'),(25,49,'XTA212300P0848296',12,14,'2023-05-16 09:29:22','2023-05-16 09:29:22'),(26,49,'Через год можно предложить обмен на новую\nКупил Гранту в 21 году, на ТО ездит довольно часто по пробегу. Работа разъездного характера.\nXTA219040M0795572',13,15,'2023-05-16 09:42:56','2023-05-16 09:42:56'),(27,49,'Связаться, если есть что предложить.\nПостоянный партнер по закупке а/м',14,16,'2023-05-16 09:44:29','2023-05-16 09:44:29'),(28,49,'Можно направлять предложение на покупку как частному лицу\nВладеют Ларгусом фургоном с 2020 года. На ТО ездят. Закупка проходила в рамках бюджетной программы. Покупка нового авто крайне маловероятна\nXTAFS035LL1298727',15,17,'2023-05-16 09:48:27','2023-05-16 09:48:27'),(29,49,'Ирина',15,17,'2023-05-16 09:50:10','2023-05-16 09:50:10'),(30,49,'Позвать на плановое ТО\nАукцион проиграли',16,18,'2023-05-16 09:56:25','2023-05-16 09:56:25'),(31,48,'планировал приехать',17,19,'2023-05-16 11:29:58','2023-05-16 11:29:58'),(32,48,'Событие завершено',17,19,'2023-05-16 11:38:23','2023-05-16 11:38:23'),(33,48,'Директор представительства Бережок Илья 8(908) 698-19-98',18,20,'2023-05-16 12:11:58','2023-05-16 12:11:58'),(34,49,'Изначально клиент план