INSERT INTO `delivery_stages` VALUES (1,'В наличии','Этот автомобиля ожидает Вас на нашем складе. Кликните по автомобилю и перейдите на страницу предложения, вероятно, она уже дополнена живыми фотографиями.'),(2,'В отгрузке','В ближайшее время этот автомобиль поступит на склад. Он уже едет к нам на автовозе или ожидает погрузку на складе завода. Срок поставки совсем небольшой.'),(3,'В производстве','Этот автомобиль запланирован в производство на заводе. Это означает, что он еще не готов, но дата сборки уже известна. Кстати, иногда еще не поздно поменять параметры машины (например, цвет или опции), для этого кликните по автомобилю и нажмите кнопку «Изменить опции».');
