INSERT INTO `mark_infos` VALUES (45,57,'НОВОЕ ЦИФРОВОЕ ПОКОЛЕНИЕ','Современный, технологичный, стремительный и стильный - автомобиль, каким он должен быть.'),(47,59,'ПРЕВОСХОДСТВО НА НАШЕЙ ТЕРРИТОРИИ','Вместимость и оснащенность, элегантность и практичность - VESTA СЕДАН превосходна во всем.'),(49,61,'БУДЬ СВОБОДНЫМ. БУДЬ СОБОЙ','Легкий на подъем, энергичный и оптимистичный. Компактный кроссовер, идеальный для жизни в городе.'),(50,62,'С МЕСТАМИ ДЛЯ ПОЦЕЛУЕВ','Путешественник, партнер по бизнесу и член семьи - это LADA LARGUS: комфортный, яркий и функциональный.'),(53,65,'ВЫРОСЛА ДИКОЙ, ПРИУЧЕНА К ГОРОДУ','LADA NIVA TRAVEL - это мощь полного привода и постоянная готовность к приключениям. К приключениям с комфортом.'),(54,66,'НОВОЕ ИМЯ ДЛЯ ЛЕГЕНДЫ','LADA NIVA LEGEND - узнаваемый стиль и прославленная проходимость.'),(55,67,'НОВОЕ ИМЯ ДЛЯ ЛЕГЕНДЫ','Трудные дорожные условия. Теснота городских кварталов. Это среда обитания LADA NIVA LEGEND.'),(60,72,'СОЗДАНА ВЫЖИТЬ','LADA NIVA BRONTO: создана выжить.'),(61,73,'С МЕСТАМИ ДЛЯ ПОЦЕЛУЕВ','Топ-модель семейства LARGUS: комфорт, повышенная проходимость и яркий CROSS-дизайн.'),(66,78,'ВСЁ ВОЗЬМЁТ НА СЕБЯ','LADA LARGUS ФУРГОН - оптимальное соотношение характеристик, важных для бизнеса.'),(67,79,'СВОЙ В ЛЮБОЙ СРЕДЕ','Кроссовер - это новые открытия, яркие эмоции и комфортный надежный автомобиль на каждый день.'),(69,81,'НОВОЕ ЦИФРОВОЕ ПОКОЛЕНИЕ','Динамичный стиль и обтекаемые формы - признак автомобиля со спортивным характером. Но GRANTA ЛИФТБЕК еще и потрясающе вместителен.'),(70,82,'НОВОЕ ЦИФРОВОЕ ПОКОЛЕНИЕ','Лаконичный, компактный, быстрый. GRANTA ХЕТЧБЕК легко идет по жизни. И по дороге.'),(72,84,'НОВОЕ ЦИФРОВОЕ ПОКОЛЕНИЕ','«Универсал» - уже в названии заложена широта характера. И разносторонняя специализация. Конечно, с ориентацией на практичность.'),(73,85,'НОВОЕ ЦИФРОВОЕ ПОКОЛЕНИЕ','Компактный и вместительный. Быстрый и внедорожный. Воплощение духа кроссоверов.'),(74,86,'СОЗДАНА БЫТЬ УНИКАЛЬНОЙ','VESTA SE CROSS - автомобиль, воплотивший любовь к седанам и суперпопулярным кроссоверам.'),(75,87,'БОЛЬШЕ МЕСТА ДЛЯ ЖИЗНИ','Стильный, вместительный, комфортный универсал. Современное сочетание практичности и элегантности.'),(76,88,'СКАЖИ ЖИЗНИ - ДА!','Единственная в своем роде. Объединяющая дерзкий дизайн, многогранность кроссовера и практичность универсала.'),(77,89,'ТВОЙ ДРАЙВ. ТВОИ ПРАВИЛА.','Автомобиль, всегда готовый к скорости, всегда готовый быть первым. Спорткар на каждый день.');
/*!40000 ALTER TABLE `mark_infos` ENABLE KEYS */;
UNLOCK TABLES;

